cy.wait(500);
// Trabajar dentro del modal visible
cy.get(".modal.show").should("be.visible").within(() => {
  // Solo usar mostrarFiltro si aplica
  if (escenario.tieneFiltro) {
    cy.get(`[onclick="mostrarFiltro('${escenario.tipo}')"]`, {
      timeout: 3000
    }).click({
      force: true
    });
  }
  // Llenar campos del escenario
  escenario.filtros.forEach(filtro => {
    cy.get(filtro.id).should("be.visible").clear().type(filtro.valor);
  });
  // Generar PDF y XLS
  cy.get("button[value='pdf']").should("be.visible").click();
  cy.wait(800);
  cy.get("button[value='xls']").should("be.visible").click();
  cy.wait(800);
  // Cerrar el modal
  cy.get("button[aria-label='Close']").should("be.visible").click({
    force: true
  });
});
// Verificar que el modal ya no esté visible
cy.get(".modal.show").should("not.exist");

